import React from 'react';
import Navbar from './Navbar';
import './styles.css';


function Header() {
  return (
    <div id='main'>
        <Navbar/>
        <div className='name'>
            <h1>
                <span className="secure">Cloud</span>
                <span className="safe">Password </span>
            </h1>
            <p className='details' >"Over 80% of data breaches are due to weak or stolen passwords. 
            Your privacy matters. With our password manager, rest assured, we've got your back."</p>
            <a href='/login' className='cv-btn'>Login</a>
        </div>
    </div>
  )
}

export default Header;
